const UnnaRegular = `@font-face { font-family: 'Unna'; font-style: normal; font-weight: 400; src: local('Unna Regular'), local('Unna-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const UnnaItalic = `@font-face { font-family: 'Unna'; font-style: italic; font-weight: 400; src: local('Unna Italic'), local('Unna-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Unna700 = `@font-face { font-family: 'Unna'; font-style: normal; font-weight: 700; src: local('Unna Bold'), local('Unna-Bold'), url('data:font/woff2;base64,') format('woff2'); }`;
const Unna700italic = `@font-face { font-family: 'Unna'; font-style: italic; font-weight: 700; src: local('Unna Bold Italic'), local('Unna-BoldItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
